import React from 'react';

function App() {
  // const url = `https://api.openweathermap.org/data/2.5/weather?lat=30&lon=120&appid=87800d5b364b73b7eb1fc78406bd1e3e`;
  return (
    <div className="App">
      <div className="container">
        <div className="top">
          <div className="location">
            <p>Dallas</p>
          </div>
          <div className="temp"></div>
        </div>
        <div className="bottom"></div>
      </div>
    </div>
  );
}

export default App;
